	digitalWrite(piyush_SX127x_NRESET_PIN_D2, piyush_SX127x_NRESET_PIN_D2_rawData);
	digitalWrite(piyush_HC-SR04_Trigger_PIN_D4, piyush_HC-SR04_Trigger_PIN_D4_rawData);
